description:
ASP.NET WEB程序的优化功能，可以优化js/css文件。而且可以对原文件名进行加密。当你发布后，访问资源将自动压缩混淆代码。再次访问将从缓存中读取。使用方法：Web.config中：<add namespace="ExfSoft.Web.Optimization"/>;网页中：
@Scripts.Render("~/packages/jquery")
@Scripts.Include("~/Scripts/abc-{version}.js")
@Scripts.Include("~/Scripts/test1.js", new { attr = "value" })
@Styles.Include("~/Content/site.css")

在使用@Scripts.Render时需要
第一步：protected void Application_Start()
{
    BundleConfig.RegisterBundles(BundleTable.Bundles);
}
第二步：
//Class Page:
    public class BundleConfig
    {
        internal static void RegisterBundles(BundleCollection bundles)
        {
            bundles.Add(new ScriptBundle("~/packages/jquery").Include(
                "~/Scripts/jQuery.{version}.js"));
        }
    }

